import{o as t,c as o,a as s}from"./index-e3b1ed5a.js";const e="/blog/assets/first-4731cfeb.png",a="data:image/png;base64,",r="/blog/assets/8fa94957d7f0a0668f3a84435e48f7aae1a9e653-61e31015.png",l="/blog/assets/lty-46f8c742.png",m="/blog/assets/小豆泥(2)-d19ebf57.gif",c="/blog/assets/0721-19ccc344.jpg",g="/blog/assets/小黑1-6f9d1746.jpg",i="/blog/assets/小黑2-b737f796.jpg",n="/blog/assets/花熏-06a66f96.png",b="/blog/assets/小豆泥(3)-ecb25215.gif",h="/blog/assets/0719-2ebb836b.jpg",d="/blog/assets/record0713-76a49ba3.png",G={class:"markdown-body"},Z="2025-06-19T00:00:00.000Z",T="2025-09-08T00:00:00.000Z",C="想法",x="实习随笔",R={__name:"实习随笔",setup(M,{expose:p}){return p({frontmatter:{date:"2025-06-19T00:00:00.000Z",updated:"2025-09-08T00:00:00.000Z",category:"想法",summary:"实习随笔"}}),(f,A)=>(t(),o("div",G,A[0]||(A[0]=[s('<h2>11</h2><p>11周，这周完整地整理一下实习学习到地内容，下周结束，回学校。</p><p>身边认识的很多同学都是保研，或者很笃定的工作，当然也有和我一样考研的，但是我落下这么多，我还有机会吗？……身边大多人比自己优秀也好，稍微更不尽人意也罢。并不是没有选择的那条路更好，每一个选择都是没有定数的，冥冥之中，命运自有安排，请相信，一起都是命中注定，一切都是最好的安排，自己唯一能做的就是认真做好选择，并坚信，每一个选择堆叠最后最好的自己。</p><p>这一周实习只简单地修复了一个的BUG，时间完全自己安排，很nice，考虑了几个问题</p><blockquote><ol><li><p>遮罩与弹窗地绑定设计，我的方法与市面上企业级地设计相差</p></li><li><p>静态函数、单例模式、DI + 单例模式的设计的优劣，总体来看第3种要合适一些，但是，软件的体量静态函数却更简单实现，单例模式进行了折中，现在堆积的大量静态函数的问题。</p></li><li><p>异步的传染性问题，高层函数调用的话，函数也会被传染为异步函数。</p></li></ol></blockquote><hr><h2>10</h2><p>学校开学，实习后，觉得学校好幸福啊，我还想当学生，呜呜呜(╥﹏╥)</p><hr><h2>9</h2><p>倒数25天，好欸。</p><p>改一个后端自定义动态列，优化了3版，原版从各方面来说都是第二优的，但是最好的版本也没有优化很多，太痛苦了，不过好像mentor 能交给我的任务也没有多少了，还剩3周半，差不多边边角角我就可以提桶跑路了。但是好像没学到关键的技术，也就MVVM规范格式，Prism 总线通信，订阅发布者模式、事件约束通信，程序还一大堆静态类(mentor 搞的)，不过我写的 Adb 和 c# 集成的 “FastApi” 接口功能实现类也是静态类欸，抱歉我是蠢蛋……</p><p>祝自己好运吧，相信光，就如同下图的希尔达一样(ง •̀_•́)ง</p><hr><h2>8</h2><p>倒计时32天，唔，上班真的痛苦(╥﹏╥)</p><p><strong>构建网站的第一天</strong> (๑˃̵ᴗ˂̵)</p><p><img src="'+e+'" alt="first"></p><p>当时就是脑子一热，在要找实习，作业一大堆，压力很大的时候，抽时间写的🥲。</p><hr><h2>7</h2><p>新的一周喽</p><p>周四，加班一个小时，太痛苦 了</p><p>🌹(●‘◡’●)🌹</p><p>Tell Me👏 Tell Me👏</p><p>鏡👏よ鏡👏</p><p>一番👏好きな👏私👏👏になるの👏👏</p><p>Tell Me👏 Tell Me👏</p><p>鏡👏よ鏡👏👏</p><p>一番👏好きな👏私👏になるの👏👏 👏 ···👏👏 👏···👏👏 👏👏👏</p><p><img src="'+a+'" alt="跟我走"> <img src="'+r+'" alt="好耶"></p><p>感觉被mentor当苦力使了，任务很多，有时间把觉得记录的知识记录下来。</p><p>好像实习后想读研的想法越来越强烈，我能深刻的感受到，实习的内容，mentor 让我完成的内容是我本科都学过的，包括操作系统层面的多线程、线程池，异步、同步；函数调用、回调；运行时内存的加载回收；MVVM模式的规范，解耦，面向对象的编程；MySQL， 索引，自然连接；系统设计模式，订阅发布者模式；处理临界区间的操作。</p><p>我想，如果我以我现在的见识，现在的知识就出来，我顶多是现在的Plus 版本而已，我难以到达更高的高度了。</p><p>另一方面，我真的还是不能接受，我的大学生活还没有很值得我纪念的人、事，我的青春就这样草草结束，我不能接受…….</p><p>嗯，对，好好复习吧，(๑•́ ₃ •̀๑) 虽然现在每天都只有晚上</p><hr><h2>6</h2><p>第六周，新的一周还是有计划要好一些了，不要没有安排了。</p><p>这周安排的任务应该是三部分：</p><blockquote><p>订阅发布模式遮罩效果的文件格式统一</p><p>Resource 的 convert 返回优化</p><p>引用的样式文件重新管理</p></blockquote><p>全是杂活呢</p><p><strong>整理</strong></p><blockquote><p>订阅发布者模式、4个异步执行（需要很详细，记录具体的实例）</p><p>（看时间吧）整理c# 包括 xaml 的具体组件的使用，和导航切换的方法</p></blockquote><p>我还是不想本科就直接出来工作，仅此而已好好努力吧(✿◠‿◠)</p><p>$\\color {red} {球球了}$ 总公司聚会实习生可以不去，我是真不想 就那么点工资还出差┗( T﹏T )┛</p><p>新的一周又开始了，倒计时 7 周后就解放了，好好加油吧，牛马。</p><p>偷张25年洛天依生贺图片</p><p><img src="'+l+'" alt="lty"></p><p>本来以为要改好久的代码，一天哐哐哐就改完了，然后mentor 出差疯狂摸鱼</p><p><img src="'+m+'" alt="小豆泥(2)"></p><p>哈哈哈(づ ●‿● )づ✧</p><p>但是复习，感觉操作系统和线代还是需要一些时间的，摸鱼抽些时间复习吧。最近有台风就骑不了自行车了，早高峰打车好麻烦了</p><hr><h2>5</h2><p><img src="'+c+'" alt="0721"></p><p><img src="'+g+'" alt="小黑1"></p><p><img src="'+i+'" alt="小黑2"></p><p>很幸运，能遇见小黑了(づ ●‿● )づ✧</p><p>周一，任务量还行，是我自己哐哐地敲代码，哈哈哈。</p><p>await 、Task.run() 还是没有完全弄懂，明天摸鱼，好好整理吧。</p><p>救命，周二，一整天，就维修好一点BUG ，感觉mentor 要diss 我 了</p><p>没事(╥﹏╥)</p><p><img src="'+n+'" alt="花熏"></p><p>好欸，又活了一周，这周任务量稍微有点大了，主要是发布订阅者模式实现弹窗主窗体遮罩效果，还行。、</p><p>嘿嘿，mentor 会间周出差，下周又差不多可以狠狠摸鱼了。</p><hr><h2>4</h2><p>(◕‿◕✿) 苦逼的一周又开始喽🥲</p><p>哈哈哈，实习没学到多少东西，复习进度也迟缓，但是吃鸡超级王牌了 ( ͡° ͜ʖ ͡°)</p><p>(╥﹏╥) 最近就像时间加速了一样，都过得还快，明明才上班没多久，就下班了，明明还没好好享受晚上自己的时间，一下就12点了，睡一觉又循环，骑自行车18分钟到公司，买一个馒头一个茶叶蛋，吃完，摸摸鱼，一下就中午，然后下午和 mentor 对接对接任务，就 6 点下班。骑自行车回家，点外卖，刷会儿视频，打一下游戏，复习，结束……</p><p><img src="'+b+'" alt="小豆泥(3)"></p><p>(●ˊωˋ●) 救命，谁上班了，事情很多，还一直优化没啥用的博客样式呀</p><p>骗子 vercel 、cursor 国区好像都受限了，好多数据库也受限的，supabase 千万不要也凉了呀┗( T﹏T )┛</p><p>周四，涉及设备的异步执行，我真的头大，感觉别人写好的代码一坨屎，我能感受到写得很多BUG ，但是我就是不知道要怎么改。</p><p>周五，好欸，摸鱼划水又过一天</p><p><img src="'+h+'" alt="0719"></p><p>小黑电影上线了好欸！！！</p><p>真的超级好看</p><hr><h2>3</h2><p>周一任务是对运行功能的抽象，记录在数据库中，进而生成测试用例库，需要满足读取时能够再次调用参数运行，但是大多参数都很多，40多个功能，分几类参数抽象，还是没有很轻松。</p><p>周二还行，虽然没给我什么任务。学习了 prism 的委托、委托的抽象接口，感觉很像 Java 欸，甚至感觉就在写 Java ,还有 viewModel 、 view 通过 prism 自动对接和处理数据 (contextData)。</p><p>明天上班的时候摸鱼整理吧</p><p>稍微有点迷茫，上班完全没有精神上获得什么，只有越来越累，越来越觉得很烦，我要考研，要读研又是为了什么啊。与mentor 交流 实例化 委托的对象的时候，为什么要用 抽象的ICommand、为什么用 DelegateCommand，第一次感受到，那种 “我是程序员啊”， 上学的时候和同学讨论，或者自己写代码，一直给我的感觉是，我在做一件事，我在写作业，我在小组讨论，我在借用 chatGPT 放大我的想法，就是没有感受到过，我是一个开发者……</p><p>很“有幸 ？”，我有了这种感觉？</p><p>摸鱼，感觉现在很奇怪欸，敲键盘，哪怕是在复习也不是很困，但是只要是单纯的用草稿纸，10分钟就困得不行了。</p><p>第三周也结束了，感觉也没啥好回顾的，上班而已。之前看干物妹小埋的时候很疑惑为什么哥哥周末会干坐没事做，呜呜呜，周六也真真实实的体会到了为什么了。平常都是由工作充斥着，甚至不太会安排自己的周末了，想好好休息，但是闲下来很不舒服，就无所事事。</p><p>突然间感觉很疑惑， 为什么我们都是看着远方自己还未得到的东西，努力着奔向远方，承受着当下的“苟且”，“好好努力，考好期末、考上好的中学、考上好的大学、努力保研、考研……努力找一个好的工作，然后我还没体验，但是好像是好好工作、买车买房、还房贷车贷、结婚”，所以一场“修炼”结束，然后无缝衔接下一场吗？</p><p>—— 好像人生本来就是需要这样吧，否则像工作日上班后周末无所事事吗？因为我的眼光太聚焦我未来想要得到的东西，却忽略了现在也是我一步步努力的来的生活，却忽略了好多快乐的时刻……初中语文老师说的话，到如今只记得一句话，“也许人生的意义就是一场漫长的体验之旅”，今年 2 月底疯狂的投简历，找实习，一直被拒，甚至感觉怀疑人生，然后 6月12号下午收到 offer ，不是也是一场很值得记录的体验吗，我确实很厉害、很值得夸赞，但是我的缺点，机试很差，这让我足足上了 3 个半月的课，</p><p><img src="'+d+'" alt="record0713"></p><p>我有好好地回应一个多月前的对话的吧。</p><p>现在再留下一个隔空对话吧 2025年 9 月 13 号的我</p><p>应该9月12号实习结束，当晚带一部分行李回学校了，然后第二天回出租屋收拾剩下的行李吧，下午回到学校，晚上就回到正常的大学生活了吧，啊救命，特别硬的床，特别难吃的饭 (๑•́ ₃ •̀) 。</p><p>祝你好运，也祝我好运。(づ ●‿● )づ✧</p><hr><h2>2</h2><p>又是周五，晚上在阳台吹吹风，看看落日。还挺不错</p><p>这周基于 WPF 框架 的 MVVM 模式写了控制手机的 adb 工具，并做了可视化，等向下周向 mentor， 展示、优化后偷来丢在 GitHub 的仓库里吧。</p><p>mentor 给的任务好抽象啊，代码还没给我看，架构没给我看，测试代码没给我看，就给了测试的功能设计说明，叫我设计测试功能的日志记录抽象设计，真就抽象设计，哈哈哈，就记录， 功能参数，返回内容，三点抽象，结束。</p><p>chat 快快加油吧 ，高级算法的作业快帮我做完🥺 。</p><p>写完高级算法作业就可以暂时 好好休息一下喽！</p><hr><h2>1</h2><p>第一周： 感觉很多都是在干打杂，虽然也没有期望什么，更多的是体验吧，还拿到实习证明，就OK了。</p><p>实习内容累倒是不累，但是每天通勤啊，实习第一个月没多少钱啊，一个人租房没人一起玩啊……累、不舒畅的感觉倒是来源于这些方向(´･_･`)。</p><p>对<strong>还有作业、论文、报告没写完</strong>， 这就太痛苦了。</p><p>学习到的东西呢：</p><ul><li>公司里的分工、交流都太细、太完善了，好难看清全局</li><li>mentor 一直 是有dll 库， 有开源包可以用吗</li><li>“你先写好一个小 demo 展示”</li><li>还行，现阶段还比较简单，对我来说能实现</li></ul><p>具体的点（详细只是记录文档写在其他文章了）</p><blockquote><p>WPF 架构、dll 动态链接库的调用、adb</p></blockquote><hr>',112)])))}};export{C as category,Z as date,R as default,x as summary,T as updated};
